import { Link } from "react-router-dom";
import classes from "./MainNavigation.module.scss";

function MainNavigation() {
  return (
    <haeader className={classes.header}>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/products">Products</Link>
          </li>
        </ul>
      </nav>
    </haeader>
  );
}

export default MainNavigation;
